--  vendors on GM Island, Model Mall, or VendorSets. All entries were extracted 
--  directly from the creature->modelid1 value where modelid1 was not NULL. 
--  
--  This assumes they are all valid and used by NPCs in game, but some are not valid 
--  and will show up as errors in the worldserver console, have missign textures, or
--  appear as untextured cubes. These issues stem from missing DBC or MPQ data but 
--  it's harmless. I've only seen a handful over hundreds of random builds. These IDs
--  can be removed from the npc_creature_model table if desired.
