USE rocket_world;

-- --------------------------------------------------------------------------------------
-- Table structure for npc_creature_model
-- --------------------------------------------------------------------------------------
DROP TABLE IF EXISTS `npc_creature_model`;
CREATE TABLE `npc_creature_model` (
  `modelid1` int(10) NOT NULL,
  `credits` varchar(30) DEFAULT '' NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


-- --------------------------------------------------------------------------------------
-- Records of  npc_creature_model
