-- --------------------------------------------------------------------------------------
-- Let's set the credits and default values for the Model Mall!
-- --------------------------------------------------------------------------------------
UPDATE `rocket_world`.`npc_creature_model` SET `credits` = 'stygianthebest.github.io' WHERE `credits` = '';
UPDATE `rocket_world`.`npc_creature_model` SET `credits` = '640' WHERE `modelid1` = '13';
UPDATE `rocket_world`.`npc_creature_model` SET `credits` = '23500' WHERE `modelid1` = '14';

-- --------------------------------------------------------------------------------------
-- StygianCoreTools :: UpdateModelRange Stored Procedure
-- --------------------------------------------------------------------------------------
DELIMITER $$
DROP PROCEDURE IF EXISTS `UpdateModelRange` $$

CREATE PROCEDURE UpdateModelRange(ModelMax INT, ModelStart INT)
BEGIN

 	UPDATE `rocket_world`.`npc_creature_model` SET `credits` = ModelMax WHERE `modelid1` = 13;
	UPDATE `rocket_world`.`npc_creature_model` SET `credits` = ModelStart WHERE `modelid1` = 14;

END $$

DELIMITER ;

