-- Pocket Portal
-- --------------------------------------------------------------------------------------
SET 
@ITEMENTRY 			:= 701002,
@NAME				:= "Pocket Portal",
@ENTRY 				:= 128,
@QUALITY			:= 7,
@MODEL				:= 29133,
@FLAGS				:= 134217728, -- BOA
@FLAGSEXTRA			:= 0,
